import './MenuPage.css'
import 'bootstrap/dist/css/bootstrap.min.css';

function MenuPage() {
  return (
    <>
      <p className="fs-1 title">Select</p>
      <p className="fs-3 title">Your</p>
      <p className="fs-1 title">Diet</p>
    </>
  );
}

export default MenuPage;
